import React from "react";

const Navbar = () => {
  return (
    <div
      style={{ backgroundColor: "black" }}
      className="ui large secondary inverted pointing menu"
    >
      <div className="ui container">
        <a href="/" className="active item">
          Main
        </a>
        <a href="/" className="item">
          My Blogs
        </a>
        <a href="/" className="item">
          Create
        </a>
      </div>
    </div>
  );
};

export default Navbar;
